import Vue from 'vue'
import VueRouter from 'vue-router'
import login from '../views/login.vue'
import register from '../views/register.vue'
import mainpage from '../views/mainpage.vue'
Vue.use(VueRouter)

const routes = [

  {
    path: '/',
    name: 'login',
    component: login
  },
  {
    path: '/register',
    name: 'register',
    component: register
  },
  {
    path: '/mainpage',
    name: 'mainpage',
    component: mainpage
  },
]

const router = new VueRouter({
  routes
})

export default router
